import './App.css';
import * as THREE from 'three'
import {Canvas} from 'react-three-fiber'
import { OrbitControls } from 'drei'

function App() {

  function Box(){
    return(
      <mesh>
        <boxBufferGeometry attach='geometry' args={[1,1,1]} />
        <meshStandardMaterial attach='material' color='green' />
      </mesh>
    )
  }

  return (
    <>
      <Canvas>
        {Box()}
      </Canvas>


    </>
  );
}

export default App;
